import React from 'react';
import './index'
import SlotM from './SlotMach'



const App = () => {
    return (
     <>
    <h1 className='heading'>🎰 Welcome to <span style={{fontWeight: 'bold'}}> Slot machine game</span> 🎰</h1>
    <div className='out'>
    <SlotM x = '😄' y = '😄' z = '😄' />
    <hr/>
    <SlotM x = '😄' y = '😏' z = '😄'/>
    <hr/>
    <SlotM x = '😄' y = '🎅' z = '🎅'/>
    <hr/>
    </div>
    </>
    )
}

export default App;
